import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  IconButton,
  Box,
  styled,
} from '@mui/material';
import {
  Menu as MenuIcon,
  PlayArrow as PlaygroundIcon,
  History as HistoryIcon,
  Star as StarredIcon,
  Settings as SettingsIcon,
  Code as ModelsIcon,
  Description as DocumentationIcon,
  Engineering as DesignEngineeringIcon,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const StyledListItem = styled(ListItem)(({ theme }) => ({
  margin: '4px 8px',
  borderRadius: '8px',
  '&:hover': {
    backgroundColor: 'rgba(0, 0, 0, 0.04)',
  },
}));

const SlideMenu = () => {
  const [open, setOpen] = React.useState(false);
  const navigate = useNavigate();

  const menuItems = [
    { text: 'Playground', icon: <PlaygroundIcon />, path: '/playground' },
    { text: 'History', icon: <HistoryIcon />, path: '/history' },
    { text: 'Starred', icon: <StarredIcon />, path: '/starred' },
    { text: 'Settings', icon: <SettingsIcon />, path: '/settings' },
    { text: 'Models', icon: <ModelsIcon />, path: '/models' },
    { text: 'Documentation', icon: <DocumentationIcon />, path: '/documentation' },
    { text: 'Design Engineering', icon: <DesignEngineeringIcon />, path: '/design-engineering' },
  ];

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setOpen(open);
  };

  const handleNavigation = (path) => {
    navigate(path);
    setOpen(false);
  };

  return (
    <>
      <IconButton
        edge="start"
        color="inherit"
        aria-label="menu"
        onClick={toggleDrawer(true)}
        sx={{
          position: 'fixed',
          left: 16,
          top: 16,
          backgroundColor: 'white',
          boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
          '&:hover': {
            backgroundColor: 'rgba(255, 255, 255, 0.9)',
          },
          zIndex: (theme) => theme.zIndex.drawer + 1,
        }}
      >
        <MenuIcon />
      </IconButton>

      <Drawer
        anchor="left"
        open={open}
        onClose={toggleDrawer(false)}
      >
        <Box
          sx={{
            width: 280,
            paddingTop: 2,
            backgroundColor: '#f8fafc',
            height: '100%',
          }}
          role="presentation"
        >
          <List>
            {menuItems.map((item) => (
              <StyledListItem 
                button 
                key={item.text}
                onClick={() => handleNavigation(item.path)}
              >
                <ListItemIcon sx={{ minWidth: 40 }}>
                  {item.icon}
                </ListItemIcon>
                <ListItemText 
                  primary={item.text}
                  sx={{
                    '& .MuiListItemText-primary': {
                      fontWeight: 500,
                    },
                  }}
                />
              </StyledListItem>
            ))}
          </List>
        </Box>
      </Drawer>
    </>
  );
};

export default SlideMenu;
